package es.iestetuan.dvj.dao.vo;

public class Empleados {

	
    private int NumEmpleado;
    private String Apellido;
    private String Oficio;
    private int CodigoDirector;
    private String FechaAlta;
    private float Salario;
    private float Comision;
    private int NumDept;
    
	public Empleados() {
		super();
		// TODO Auto-generated constructor stub
	}

	public int getNumEmpleado() {
		return NumEmpleado;
	}

	public void setNumEmpleado(int numEmpleado) {
		NumEmpleado = numEmpleado;
	}

	public String getApellido() {
		return Apellido;
	}

	public void setApellido(String apellido) {
		Apellido = apellido;
	}

	public String getOficio() {
		return Oficio;
	}

	public void setOficio(String oficio) {
		Oficio = oficio;
	}

	public int getCodigoDirector() {
		return CodigoDirector;
	}

	public void setCodigoDirector(int codigoDirector) {
		CodigoDirector = codigoDirector;
	}

	public String getFechaAlta() {
		return FechaAlta;
	}

	public void setFechaAlta(String fechaAlta) {
		FechaAlta = fechaAlta;
	}

	public float getSalario() {
		return Salario;
	}

	public void setSalario(float salario) {
		Salario = salario;
	}

	public float getComision() {
		return Comision;
	}

	public void setComision(float comision) {
		Comision = comision;
	}

	public int getNumDept() {
		return NumDept;
	}

	public void setNumDept(int numDept) {
		NumDept = numDept;
	}
	
	
    
    
	
}
